import React, { useState } from 'react';

export default function Dashboard() {
  const [newTask, setNewTask] = useState('');

  return (
    <div>
      <center><h2>Add tasks</h2></center>
      <div >
        <input
        type="text"
        value={newTask}
        onChange={(e) => setNewTask(e.target.value)}
        />
      </div>

      
    </div>
  );
}
